import { view as view_1 } from "./SelectModal";
import { availableAnimatedFilters, availableFilters, name } from "./Filters/CombinedFilter";
import CurriedLambda from "./fable-core/CurriedLambda";

function view(filters, isVisible, dispatch) {
  return view_1(filters, null, name, function (x, y) {
    return x.Equals(y);
  }, isVisible, dispatch);
}

export const common = CurriedLambda(function (isVisible, dispatch) {
  return view(availableFilters, isVisible, dispatch);
});
export const animated = CurriedLambda(function (isVisible, dispatch) {
  return view(availableAnimatedFilters, isVisible, dispatch);
});